    public string GetColor(double deger)
    {
        if (deger == 0)
        {
            return "red";
        }
        else if (deger == 1)
        {
            return "green";
        }
        else if (deger == -1)
        {
            return "blue";
        }
        else
        {
            return "black";
        }
    }
    public string VeriGoster(double deger)
    {
        string yeniDeger = deger.ToString();
        if (deger == 0)
        {
            yeniDeger = "LOW";
            return yeniDeger;
        }
        else if (deger == 1)
        {
            yeniDeger = "HIGH";
            return yeniDeger;
        }
        else if (deger == -1)
        {
            yeniDeger = "NONE";
            return yeniDeger;
        }
        else
        {
            return yeniDeger;
        }
    }


